        "The farther away you are from the server and the worse your Internet connection is, the longer it will take for your message to reach the game server.": "Bạn càng ở xa máy chủ và kết nối Internet của bạn càng kém thì tin nhắn của bạn sẽ mất nhiều thời gian hơn để đến được máy chủ.",
