        "When you click or tap on maximum/minimum bet, the amount filled in will be the amount deducted from your balance when you push the BET button. Be careful! No refunds will be given for Max bet accidents. NO EXCEPTIONS. Sorry.": "Khi bạn nhấn hoặc nhấp vào đặt cược tối đa/tối thiểu, số tiền điền vào sẽ là số tiền được trừ khỏi số dư của bạn khi bạn nhấn nút CƯỢC. Hãy cẩn thận! Sẽ không hoàn tiền cho các cược đặt tối đa ngoài ý muốn. KHÔNG CÓ NGOẠI LỆ. Xin thông cảm.",
